import TweetBox from './Tweetbox.js'
import './Feed.css'
import Post from '../post/Post.js'
import { getPosts } from "./../../_actions/getPosts";
import { useDispatch, useSelector } from "react-redux";
function Feed(userData) {
   console.log(userData.userData)
   const id=userData.userData._id;
//    alert(id)

    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(getPosts(id));
    }, [localStorage.getItem("posts"), dispatch]);

    return (
        <div className="feed">
            {/* Header */}
            <div className="feed__header">
                <h2>Home</h2>
            </div>

            {/* TweetBox */}

            <TweetBox/>
            <Post displayName={userData.userData.name} displayHandle={userData.userData.email}/>
            {/* <Post />
